package practiceprogram;

public class swapnumber {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
int num=10,num2=20;

System.out.println("before swaping, fisrt no. = "+num);
System.out.println("before swaping, second no. = "+num2);
System.out.println("------------------------ ");
int temp=num;
num=num2;
num2=temp;
System.out.println("after swaping, fisrt no. = "+num);
System.out.println("after swaping, second no. = "+num2);


	}

}
